import React,{ Component  } from "react";
import error from './images/404-page_ipop2d.png';
class  Error extends Component{
    render() {
        return(
            <div className="container">
                <div className="row justify-content-center">

                    <div className="col-sm-9 col-md-6 col-lg-5 col-xl-12 p-0 ml-lg-1">
                        <img src={error} width={'auto'} height={'500px'}/>
                    </div>
                </div>

            </div>
        )
    }

}
export default Error;
